import React from 'react';

const MyProfile = ({posts, token, setPosts}) => {
    return <>
        <h1>My Profile</h1>
        {
            token && posts.isAuthor && posts.map(post => <div>MyPosts: {post.isAuthor}</div>)
        }
    </>
}

export default MyProfile;
